import React from 'react';
import FailedStamp from '../assets/FAILEDStamp.png';

function FailGame() {
    const navigate = useNavigate();
  return (
    <div className="stamp">
      <img src={FailedStamp} alt="Failed" className="w-64 h-auto" />
      <button className="stampButton" onClick={() => navigate("../pages/challenges.jsx")}>
        Return
      </button>
    </div>
  );
}

export default FailGame;
